css:
@font-face {
  font-family: "icomoon";
  src: url(atom://tree-view-git-status/resources/fonts/icomoon.woff) format("woff");
  font-weight: normal;
  font-style: normal;
}
.icomoon {
  font-family: "icomoon";
  text-align: center;
}
.icon-long-arrow-down {
  font-family: "icomoon";
  text-align: center;
  content: "\f175";
}
.icon-long-arrow-up {
  font-family: "icomoon";
  text-align: center;
  content: "\f176";
}
.tooltip .tooltip-inner .git-status-tooltip {
  display: flex;
  flex-flow: row nowrap;
  text-align: left;
}
.tooltip .tooltip-inner .git-status-tooltip .titles-container {
  display: flex;
  flex-flow: column nowrap;
  text-align: right;
  padding-right: 5px;
}
.tooltip .tooltip-inner .git-status-tooltip .titles-container .title {
  flex: 1 auto;
  opacity: 0.8;
  line-height: 1.5em;
}
.tooltip .tooltip-inner .git-status-tooltip .titles-container .title::after {
  content: ":";
}
.tooltip .tooltip-inner .git-status-tooltip .items-container {
  display: flex;
  flex-flow: column nowrap;
}
.tooltip .tooltip-inner .git-status-tooltip .items-container .item {
  line-height: 1.5em;
}
/**
 * Git Flow specific styling.
 */
.project-root .header.list-item .tree-view-git-status .branch-label__prefix--feature,
.project-root .header.list-item .tree-view-git-status .branch-label__icon--feature {
  color: #73c990;
}
.project-root .header.list-item .tree-view-git-status .branch-label__prefix--release,
.project-root .header.list-item .tree-view-git-status .branch-label__icon--release {
  color: #e2c08d;
}
.project-root .header.list-item .tree-view-git-status .branch-label__prefix--hotfix,
.project-root .header.list-item .tree-view-git-status .branch-label__icon--hotfix {
  color: #ff6347;
}
.project-root .header.list-item .tree-view-git-status .branch-label__prefix--develop,
.project-root .header.list-item .tree-view-git-status .branch-label__icon--develop {
  color: #6494ed;
}
.project-root .header.list-item .tree-view-git-status .branch-label__prefix--master,
.project-root .header.list-item .tree-view-git-status .branch-label__icon--master {
  color: rgba(157, 165, 180, 0.6);
}
.project-root .header.list-item .tree-view-git-status .branch-label__icon,
.project-root .header.list-item .tree-view-git-status .branch-label__icon:before {
  width: auto;
  padding-left: .1rem;
  margin-right: .2rem;
  font-size: 1rem;
}
.project-root.git-status-modified .header-git-status {
  color: #e2c08d;
}
.project-root .header.list-item .tree-view-git-status::before {
  content: "[";
}
.project-root .header.list-item .tree-view-git-status::after {
  content: "]";
}
.project-root .header.list-item .tree-view-git-status {
  margin-left: 5px;
}
.project-root .header.list-item .tree-view-git-status span {
  margin-right: 5px;
}
.project-root .header.list-item .tree-view-git-status span:last-child {
  margin-right: 0px;
}
.project-root .header.list-item .tree-view-git-status .commits-ahead-label::before {
  font-size: 9.6px;
  margin-right: 2px;
  font-family: "icomoon";
  text-align: center;
  content: "\f176";
}
.project-root .header.list-item .tree-view-git-status .commits-behind-label::before {
  font-size: 9.6px;
  margin-right: 2px;
  font-family: "icomoon";
  text-align: center;
  content: "\f175";
}
